import React from 'react';
import './service.scss';

const Service = (props) => {

    console.log(props.image);

    // const { image } = this.props;

    return (
        <div className="service">
            <div className="container">
                <div className="row">
                    <div className="col-12">
                        <div className="card">
                            <div className="card-title">
                                <h3 className="text-center">CORPORATE WEBSITES</h3>
                            </div>
                            <div className="card-body">
                                <img className="img-fluid" src={props.image} alt="Servicio-corporativo"/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Service;
